data:
  definition: valeur de la puissance électrique absorbée dans les conditions définies
    par les caractéristiques assignées au circuit d'entrée du relais
  examples: []
  notes:
  - Il s'agit d'une valeur de courte durée (et non d'une valeur en régime établi),
    la bobine du relais étant à la température ambiante.
